def reverse_execute(code, output):
    values = code.split(" ")
    a = [int(i.split("/")[0]) for i in values]
    b = [int(i.split("/")[1]) for i in values]
    inp = output
    changed = True
    while changed:
        changed = False
        for i in range(len(a)):
            if inp % a[i] == 0:
                inp = inp * b[i] // a[i]
                changed = True
    return inp


